import React, { Component } from 'react';
import {Col, Row, ButtonToolbar, Button, Container} from 'react-bootstrap';
import Link from 'next/link';
import Head from 'next/head';
import Header from '../components/header.js';
import DashboardSection from '../components/dashboardsection.js'
import fetch from 'isomorphic-unfetch'
import {withRouter} from 'next/router'

class Dashboard extends Component{

//   static async getInitialProps({children, router, href}) {
// console.log(children)
// console.log(router)
// console.log(href)
// }
constructor(props){

  this.getData = this.getData.bind(this)
}

 async getData(){
  var id = this.props.router

  const res = await fetch(`https://9d170bae.ngrok.io/Accounts/${id}/secret`)
  const json = await res.json()
  this.setState({test: json})
  console.log(json)
}

  componentDidMount(){

      getData()
  }


  render(){
    // console.log(this.props.router)
    console.log("dash")
    console.log(this.state)
    return (
      <Container>
        <Head>
        <link
        rel="stylesheet"
        href="https://maxcdn.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css"
        integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T"
        crossOrigin="anonymous"
      />
        </Head>
        <Header />
        <Row>
          <Col>
            <WelcomeMessage name={true} />
            <DashboardSection title="Alerts" />
            <DashboardSection title="Accounts" />
            <DashboardSection title="Bills" />
          </Col>
        </Row>
      </Container>
    )
  }
}


class WelcomeMessage extends Component {

  render(){
    return (
      <Row>
        <Col>
        <p>Welcome, {this.props.name} </p>
        </Col>
      </Row>
    )
  }
}


export default withRouter(Dashboard)
